import React, { Component } from "react";
import { Menu, Icon, Input } from "antd";

const { SubMenu } = Menu;

class AppNavbar extends Component {
  state = {};
  render() {
    return (
      <Menu mode="horizontal">
        <Menu.Item key="home">
          <a href="/">
            <Icon type="home" />
            SUSTechDoc
          </a>
        </Menu.Item>
        <Menu.Item>
          <Input placeholder="search files" />
        </Menu.Item>
      </Menu>
    );
  }
}

export default AppNavbar;
